import React, { Component } from 'react';
import { Link } from 'react-router-dom'

class HomePage extends Component {
  render () {
    console.log(this.props)
    return (
      <div className="container">
        <h1 style={{textAlign: 'center'}} className="subtitle">Welcome to</h1>
        <h1 style={{textAlign: 'center'}} className="title">SideQuest</h1>
        <ul>
        <div className="columns">
          <li className="column"><Link to="/login">Go to Login</Link></li>
          <li className="column"><Link to="/signup">Go to Signup</Link></li>
        </div>
        </ul>
      </div>
    );
  }
}

export default HomePage;
